// import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
// import { Link } from 'react-router-dom';
import SignUpPage from './Components/Signup/Signuppage';

function App() {
  return (
  <Router>
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Service Connect application</h1>
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
          This is the Landing page for your service connect application
        </p>
        <img
          src="https://play-lh.googleusercontent.com/tQmR5EZNyFDGsAe_JgwB_urSHLguhO7bU1EeaC0xH3mpADpcgS0o0BFOdCh3QyAYllWb=w240-h480-rw" // Replace with your image URL
          alt="React Logo"
          style={{ maxWidth: '100%', height: 'auto' }}
        />
        <Routes>
            <Route path="/login" element={<h2>Login Page</h2>} />
            <Route path="/signup" element={<SignUpPage />} />
        </Routes>
          {/* Buttons to navigate to login and signup pages */}
          <button onClick={() => window.location.assign('/login')}>Login Page</button>
          <br />
          <button onClick={() => window.location.assign('/signup')}>Sign Up Page</button>
      {/* 
      <Link to="/signup">Sign Up Page</Link>
        <Router>
        <Routes>
        <Route path='/signup' element={<SignUpPage/>} />
      </Routes>
      </Router> */}
      </header>
    </div>
    </Router>
  );
}

export default App;
